import { Component, OnInit } from '@angular/core';
import { Friend } from './model/friend';

@Component({
  selector: 'app-friends',
  templateUrl: './friends.component.html',
  styleUrls: ['./friends.component.css'],
})
export class FriendsComponent implements OnInit {
  listOfFriends: Friend[] = [];
  title = 'friend list';

  ngOnInit(): void {
    this.listOfFriends = [
      { id: 1, name: 'Carlo', age: 22, national: 'Ethiopia' },
      { id: 2, name: 'Mamdou', age: 21, national: 'Senegal' },
      { id: 3, name: 'Samule', age: 19, national: 'Nigeria' },
      { id: 4, name: 'Sale', age: 24, national: 'Ghana' },
    ];
  }
}
<h1>{{ title }}</h1>
<h2>{{ listOfFriends[0].name }}</h2>
